import Vue from 'vue';
import Chart from 'chart.js';
export default class ChartTest extends Vue{
    Oxygen:any;
    Chloro:any;
    Salinity:any;
    Water_temp:any;
    Turbidity:any;

    plot_data(extract_data:{[key:number]:Array<any>}){
        let ctx1=<HTMLCanvasElement>document.getElementById("oxygen");
        let data_length=extract_data[1].length;
