                        backgroundColor: "rgba(0,0,0,0)"
                    }
                ]
            },
            options:{
                title:{
                    display:true,
                    text:"溶存酸素"
                },
            scales: {
                yAxes: [{
                    ticks: {
                        // suggestedMax: 8,
                        // suggestedMin: 5,
                        // stepSize: 3,
                        callback: function(value, index, values){
                            return value;
                            // return  value +  'm';
                            }
                        }
                    }]
                }
            }
       })
