                    ticks: {
                        // suggestedMax: 40,
                        // suggestedMin: 25,
                        // stepSize: 5,
                        callback: function(value, index, values){
                            return value;
                            // return  value +  'm';
                            }
                        }
                    }]
                }
            }
        })
        let ctx4=<HTMLCanvasElement>document.getElementById("water_temp");
        this.Water_temp = new Chart(ctx4, {
