                        }),
                        borderColor: "rgba(100,100,100,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    }
                ]
            },
            options:{
                title:{
                    display:true,
                    text:"水温"
                },
            scales: {
                yAxes: [{
                    ticks: {
                        // suggestedMax: 40,
                        // suggestedMin: -10,
                        // stepSize: 5,
                        callback: function(value, index, values){
                            return value;
                            // return  value +  'm';
                            }
                        }
                    }]
                }
            }
        })
        let ctx5=<HTMLCanvasElement>document.getElementById("turbidity");
        this.Turbidity = new Chart(ctx5, {
            type:'line',
            data:{
                labels:[...Array(data_length)].map((_,index)=>index),
                datasets:[
                    {
                        label:"3[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[3][index].turbidity);
                        }),
                        borderColor: "rgba(255,0,0,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"6[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[6][index].turbidity);
                        }),
